import "./styles.css";

import { Route, Routes } from "react-router";

import Home from "./routes/Home";
import Navbar from "./components/Navbar";

export default function App() {
  return (
    <div className="App">
      <Routes>
        <Route/>
      </Routes>
      <Navbar/>
      <Home/>
    </div>
  );
}
